import exampleresponse from "./exampleresponse.json"
const VideoCard =()=>{
    return (
        <div>
        {exampleresponse.map(video=>
                    {return (<div>
                     <h2>{video.title}</h2>
                     <h2>{video.rating}</h2>

                   </div>)
          })}

        </div>)
}
export default VideoCard;
